import React from "react";
import { createMaterialBottomTabNavigator } from "@react-navigation/material-bottom-tabs";
import {
  Feather,
  Ionicons,
  MaterialCommunityIcons,
  MaterialIcons,
} from "@expo/vector-icons";
import Pumpscreen from "../Screen/Pump/Pumpscreen";
import Feedscreen from "../Screen/Feed/Feedscreen";
import HomeStack from "./HomeStack";
import Homescreen from "../Screen/Home/Homescreen";
import PumpTabScreen from "../Screen/Pump/PumpTabScreen";

const BottomStack = createMaterialBottomTabNavigator();
const BottomNav = () => {
  return (
    <BottomStack.Navigator
      initialRouteName="Home"
      activeColor="#00FFCC"
      labeled={false}
      barStyle={{
        backgroundColor: "#004146",
        overflow: "hidden",
        position: "absolute",
        bottom: 25,
        left: 20,
        right: 20,
        elevation: 0,
        borderRadius: 20,
        height: 60,
        flex: 1,
      }}
      shifting={true}
    >
      <BottomStack.Screen
        name="Home"
        component={Homescreen}
        options={{
          tabBarIcon: ({ color, focused }) => {
            return <Ionicons name="ios-home" size={25} color={color} />;
          },
        }}
      />
      <BottomStack.Screen
        name="Pump"
        component={PumpTabScreen}
        options={{
          tabBarIcon: ({ color, focused }) => {
            return (
              <MaterialCommunityIcons
                name="lightning-bolt-outline"
                size={30}
                color={color}
              />
            );
          },
        }}
      />
      <BottomStack.Screen
        name="Feed"
        component={Feedscreen}
        options={{
          tabBarIcon: ({ color, focused }) => {
            return <Feather name="tv" size={25} color={color} />;
          },
        }}
      />
    </BottomStack.Navigator>
  );
};

export default BottomNav;
